script: |
  super -f text -I q4854.spq | sort > q4854.out

inputs:
  - name: q4854.spq
    data: |
      SELECT DISTINCT 61 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( - col2 + col1 + - 96 + + col2 * - CAST ( NULL AS INTEGER ) + - col0 * + - col1 * - col1 * + CAST ( NULL AS INTEGER ) );
  - name: tab2

outputs:
  - name: q4854.out
    data: |
